const cacheName="files";addEventListener("fetch",fetchEvent=>{const request=fetchEvent.request;"GET"===request.method&&fetchEvent.respondWith(async function(){const responseFromFetch=fetch(request);if(fetchEvent.waitUntil(async function(){const responseCopy=(await responseFromFetch).clone(),myCache=await caches.open("files");await myCache.put(request,responseCopy)}()),!request.headers.get("Accept").includes("text/html")){const responseFromCache=await caches.match(request);return responseFromCache||responseFromFetch}try{return await responseFromFetch}catch(error){return caches.match(request)}}())});